import React from "react";
import Input from '@mui/joy/Input';
import Button from '@mui/joy/Button';
import AuthStyle from "../../../../styles/Auth/Auth.css";
import { useNavigate } from "react-router";
import { useDispatch } from "react-redux";
import { fetchRegister } from "../../../../redux/reducers/TypeAuth";


const { FormAuth } = AuthStyle

const {flagCaptcha} = props

function Regist() {

    const navigate = useNavigate()
    const dispatch = useDispatch()

    let login = "",
        pass = "",
        secPass = ""


    function sendData() {
        if (flagCaptcha) {
            let data = {
                login: login,
                pass: pass,
                secPass: secPass
            }
            dispatch(fetchRegister({data}))
        }

    }

    return (
        <>
            <FormAuth>
                <Input
                    onChange={(event) => { login = event.target.value }}
                    placeholder="Введите логин"
                    size="md"
                    variant="soft"
                />
                <Input
                    onChange={(event) => { pass = event.target.value }}
                    type="password"
                    placeholder="Введите пароль"
                    size="md"
                    variant="soft"
                />
                <Input
                    onChange={(event) => { secPass = event.target.value }}
                    type="password"
                    placeholder="Повторите пароль"
                    size="md"
                    variant="soft"
                />
                <Button onClick={sendData}>Войти</Button>
            </FormAuth>
        </>
    )
}

export default Regist
